import React from 'react'
import LocationOnIcon from "@mui/icons-material/LocationOn";
const Quote = () => {
  return (
    <div>
      <div className="container mx-auto">
        <div className="grid grid-cols-3">
          <div className="">
            <LocationOnIcon sx={{ fontSize: 90 }} />
            <h3>Dhaka Office</h3>
            <p></p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Quote
